import NewsList from './NewsList';
import Footer from './Footer'; 
import Header from './Header';
import Topnews from './Topnews';
import Links from './links';

const App = () => {
  return (
    <div>
      <div className='container'>
        <Header/>
        <Links/>
        <Topnews/>
        <NewsList endpoint='world' />
      </div>
      <Footer />
    </div>
  );
};

export default App;
